import React from 'react';
import { BrowserRouter}from 'react-router-dom';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
// import Home from '.';
import reportWebVitals from './reportWebVitals';


ReactDOM.render(
  <BrowserRouter>
      <App />
  </BrowserRouter>, 
  document.getElementById('root')
)
